window.bookSummaryJSON = "<p><b><i>New York Times</i> best-selling author Mira Grant, author of the renowned Newsflesh series, returns with a novel that takes us to a new world of ancient mysteries and mythological dangers come to life. </b> </p> <p><i>The ocean is home to many myths, </i> </p> <p><i>But some are deadly....</i> </p> <p>Seven years ago the <i>Atargatis</i> set off on a voyage to the Mariana Trench to film a mockumentary bringing to life ancient sea creatures of legend. It was lost at sea with all hands. Some have called it a hoax; others have called it a tragedy. </p> <p>Now a new crew has been assembled. But this time they're not out to entertain. Some seek to validate their life's work. Some seek the greatest hunt of all. Some seek the truth. But for the ambitious young scientist Victoria Stewart, this is a voyage to uncover the fate of the sister she lost. </p> <p>Whatever the truth may be, it will be found only below the waves. </p> <p><i>But the secrets of the deep come with a price. </i> </p> <p><b><i>More from Mira Grant</i></b> </p> <p><b>Newsflesh</b> </p> <p></p> <ul> <li><i>Feed</i> </li> <li><i>Deadline</i> </li> <li><i>Blackout</i> </li> <li><i>Feedback</i> </li> </ul> <p></p> <p><i>Rise: A Newsflesh Collection</i> </p> <p><b>Parasitology</b> </p> <p></p> <ul> <li><i>Parasite</i> </li> <li><i>Symbiont</i> </li> <li><i>Chimera</i> </li> </ul> <p></p>"; 
